// 如果描边有多个，需要叠加起来
const drawStroke = (ctx: CanvasRenderingContext2D, strokes: any[]) => {
  strokes.forEach((stroke) => {
    const { color, size } = stroke
    const { r, g, b } = color
    ctx.strokeStyle = `rgb(${r}, ${g}, ${b})`
    ctx.lineWidth = size.value
    ctx.stroke()
  })
}
